	@allure.feature("清算中心-查询服务明细")
	@allure.severity("blocker")
	def test_openQueryVas(self):
		"""
		清算查服务明细
		"""
		openQueryVas=newCleanCenter.openQueryVas()
		openQueryVas.headers = {"Content-Type":"application/json;charset=UTF-8","Authorization":"Bearer 36bf61a5-8600-4d37-b5c2-b330f12fc820"}
		openQueryVas.changeEnv("uniondrug.net")
		openQueryVas.data = { "mainOrderNo": "92050601603435061618", "orderType": 1 }
		openQueryVasRes = openQueryVas.excute()
		assert openQueryVasRes.text.__contains__("百癣夏塔热片")

